import React from "react";
import Header from "./Header";
import Footer from "./Footer";

const Five = () => {
  return (
    <div>
      <Header />
      <div className="five-container"></div>
      <div className="foot-container">
        <Footer />
      </div>
    </div>
  );
};

export default Five;
